import React from 'react';
import ProfileCard from './ProfileCard';
import '../styles/Home.css';

const dummyProfiles = [
  {
    id: 1,
    name: 'Ananya Sharma',
    bio: 'Frontend Developer & UI Enthusiast',
    image: 'https://randomuser.me/api/portraits/women/1.jpg',
    fullBio: 'I am passionate about creating intuitive interfaces that solve real user problems. I have 4+ years of experience in React, Figma, and responsive design.',
    workLink: 'https://ananya.dev',
    twitter: 'https://twitter.com/ananyadev',
    instagram: 'https://instagram.com/ananyadev',
    workImages: [
      'https://via.placeholder.com/150',
      'https://via.placeholder.com/150/0000FF',
    ]
  },
  {
    id: 2,
    name: 'Ravi Kumar',
    bio: 'Full Stack Developer',
    image: 'https://randomuser.me/api/portraits/men/2.jpg',
    fullBio: 'I specialize in building scalable web applications using the MERN stack. I enjoy working on open-source projects and contributing to the tech community.',
    workLink: 'https://ravikumar.dev',
    twitter: 'https://twitter.com/ravikumar',
    instagram: 'https://instagram.com/ravikumar',
    workImages: [
      'https://via.placeholder.com/150/FF0000',
      'https://via.placeholder.com/150/00FF00',
    ]
  },
  {
    id: 3,
    name: 'Priya Mehta',
    bio: 'Data Scientist & ML Engineer',
    image: 'https://randomuser.me/api/portraits/women/3.jpg',
    fullBio: 'I love turning data into actionable insights. My expertise lies in machine learning, NLP, and deep learning models.',
    workLink: 'https://priyamehta.ai',
    twitter: 'https://twitter.com/priyamehta',
    instagram: 'https://instagram.com/priyamehta',
    workImages: [
      'https://via.placeholder.com/150/FFFF00',
      'https://via.placeholder.com/150/00FFFF',
    ]
  },
  {
    id: 4,
    name: 'Aman Verma',
    bio: 'Backend Engineer',
    image: 'https://randomuser.me/api/portraits/men/4.jpg',
    fullBio: 'Skilled in API development, database design, and system architecture. I build secure and high-performance backends.',
    workLink: 'https://amanverma.tech',
    twitter: 'https://twitter.com/amanverma',
    instagram: 'https://instagram.com/amanverma',
    workImages: [
      'https://via.placeholder.com/150/FFA500',
      'https://via.placeholder.com/150/800080',
    ]
  },
];


const Home = () => {
  return (
    <div className="home-container">
      <h1>Explore Skill Sharers</h1>
      <input
        type="text"
        placeholder="Search by skill, name, or interest..."
        className="search-bar"
      />
      <div className="card-grid">
        {dummyProfiles.map(profile => (
          <ProfileCard key={profile.id} profile={profile} />
        ))}
      </div>
    </div>
  );
};

export default Home;
